import './App.css';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { Checkbox } from '@mui/material';
import {useState} from 'react';
import {ListItemButton, ListItemText} from '@mui/material';

function App() {
  let [inputvalue, setInputValue] = useState('')
  let [data, setData] = useState([])
  const displayInput = (event) =>{
    let changeval = event.target.value
    setInputValue(changeval)
    console.log(inputvalue)
  }
  const updateval = () =>{
    let imp = [...data,inputvalue]
    console.log(imp)
    setData(imp);
  }


  return (
    <div className="App">
      <header className="App-header">
        <h1>THINGS TO DO</h1>
        <div style={{display:"block"}}>
        <TextField fullWidth id="outlined-basic" label="Add More" variant="outlined"   style={{alignContent:'center'}} onChange={displayInput} />
        <Button variant="contained" onClick={updateval}>Add More</Button>
        </div>
        {
          data.map(d1 => <ul><Checkbox/>{d1}</ul>)
        }
        <ListItemButton component="a" href="#simple-list">
          <ListItemText primary="Spam" />
        </ListItemButton>
      </header>
    </div>
  );
}

export default App;
